import React from 'react';
import { StyleSheet, View } from 'react-native';
import { useHistory } from 'react-router-native';
import { SignInWithGoogle, SignInWithFacebook } from '../firebase/firebaseFunctions';
import Button from './Button';
import Text from './Text';

const styles = StyleSheet.create({
  container: {
    flexDirection: 'column',
    backgroundColor: 'white',
    justifyContent: 'center',
    height: '100%',
    width: '100%',
    position: 'absolute'
  },
  button: {
    margin: 30
  },
  heading: {
    alignItems: 'center',
    marginBottom: 50
  }
});


const SignUpPage = () => {

  const history = useHistory();

const submitSignInWithGoogle = () => {
    SignInWithGoogle();
    history.push('/');
};

const submitSignInWithFacebook = () => {
  SignInWithFacebook();
  history.push('/');
};




  return (
    <>
       <View style={styles.container}>

        <View style={styles.heading}>
          <Text color={'primary'} fontSize={'heading'} fontWeight={'bold'}>
            Sign up
        </Text>
        </View>
        <Button onPress={() => {history.push("/sign-up-email");}} style={styles.button}>
            Sign up with Email
        </Button>
        <Button onPress={submitSignInWithGoogle} style={styles.button}>
            Sign up with Google
        </Button>
        <Button onPress={submitSignInWithFacebook} style={styles.button}>
            Sign up with Facebook
        </Button>
        <Button onPress={() => {history.push('/sign-up-phone');}} style={styles.button}>
            Sign up with phonenumber
        </Button>
       </View>
    </>

  );
};

export default SignUpPage;
